import React, { Component } from 'react';
import NavList from '../block/NavList';
import Logo from '../atoms/Logo.js';

export default function Footer() {
    const FooterStyle = {
        background: "#FFF",
        textAlign: "center",
        marginTop: "30px",
        marginBottom: "50px"
    }
    const NavStyle = {
        display: "flex"
    }
    const logoStyle = {
        fontSize: '0.8em',
        marginBottom: "20px"
    }
    return (
        <footer>
            <div style={ FooterStyle }>
                <Logo style={ logoStyle } />
                <NavList style={ NavStyle } />
            </div>
        </footer>
    );
}
